import React, { useEffect } from 'react';
import { useGLTF } from '@react-three/drei';
import { GLTFLoader } from '../node_modules/three/examples/jsm/loaders/GLTFLoader.js';

function DigitalHuman() {
  window.createImageBitmap = undefined
  const { scene, materials, textures, isLoading, error } = useGLTF('/models/carrot.glb', true); // Ensure the second argument is true for loading optimally

  useEffect(() => {
    if (error) {
      console.error('Error loading model:', error);
    }
    if (isLoading) {
      console.log('Loading model...');
    }
    if (scene) {
      console.log('Model loaded:', scene);
      console.log('Materials:', materials);
      console.log('Textures:', textures);
    }
  }, [scene, materials, textures, isLoading, error]);

  if (error) {
    return <p>Error loading model.</p>;
  }
  if (isLoading) {
    return <p>Loading model...</p>;
  }
  return <primitive object={scene} scale={2} position={[0, -1.5, 0]} />;
}

export default DigitalHuman;
